import React from 'react';
import { TextField, Container, Typography, makeStyles, Button } from '@material-ui/core';

const reminderStyle = makeStyles({
    textfield: {
        marginTop: "10px",

    }
})

function CreateReminder() {
    const classes = reminderStyle();

    return (
        <Container>
            <Typography variant="h4" align="center">
                Reminders
            </Typography>
            <Typography variant="h6" >
                Creat a reminder
            </Typography>

            <form 
            noValidate 
            >
                <TextField 
                label="Reminder"
                variant="outlined"
                color="secondary"
                className={classes.textfield}
                required
                />

                <TextField 
                className={classes.textfield}
                label="Due Date"
                variant="outlined"
                color="secondary"
                required
                />
            </form>

            <Button type="submit" disableElevation variant="contained">
                Add Reminder
            </Button>
        </Container>
    )
}

export default CreateReminder
